import React, { Component } from "react";
import Jumbotron from "../components/Jumbotron";
import { Col, Row, Container } from "../components/Grid";
import { BrowserRouter as Router, Link } from "react-router-dom";

const topButton={
    margin: "30px 20px 20px 20px",
    color: "white",
    textAlign: "center",
    display: "flex",
    // alignContent: "center"
}

const bottomButton={
    margin: 20,
    color: "white",
    textAlign: "center",
    display: "flex",
    // alignContent: "center"
}

const title={
    color: "white",
    textAlign: "center",
    padding: "60px 40px 30px 40px",
}

class Home extends Component {

  render() {
    return (
        <Container fluid>
            <Row>
                <Col size="md-6">
                        <h1 style={title}>You Can Do This.</h1>
                </Col>
            </Row>
            <Row>
                <Col size="sm-6">
                    <Link to="/add" style={topButton}><i class="play icon"></i></Link>
                </Col>
                <Col size="sm-6">
                    <Link to="/exercise" style={bottomButton}><i class="play icon"></i></Link>
                </Col>
            </Row>
        </Container>
    )
  }
}

export default Home;
